1, sartu SD txartela makinan;
2, babeskopia bat egin;
3, SD txartela kendu eta sartu makina berria;
4, ireki makina berriaren babeskopia eta aplikazioaren berreskurapena, aukeratu babeskopiaren bilaketa babeskopiaren fitxategikoa berreskuratze funtzioarekin leheneratzeko. Ordenagailuaren ordezkapenaren bidez:
1, babeskopia egin eta ikusi babeskopiaren bidea;
2, makina ordenagailu batera konektatuta dago, eta ireki telefonoaren direktorioa;
3, kopiatu babeskopiaren bidearen babeskopiaren fitxategia ordenagailuan;
4, mugikor berria ordenagailura konektatuta dagoela ireki telefono berriaren direktorioa;
5, kopiatu babeskopiaren fitxategia telefono berriaren edozein direktoriora;
6,ireki makina berriaren babeskopia eta aplikazioaren berreskurapenak, aukeratu babeskopiaren bilaketa babeskopiaren fitxategikoa berreskuratze funtzioarekin leheneratzeko."

